import { Link } from 'react-router-dom';
import { Dropdown } from 'semantic-ui-react';

function NavBar({ currentUser, setCurrentUser }) {
    function logout(){
        setCurrentUser(null);
    }

    return(  
        <div>
            <Dropdown attached="top" text="Raregifs" as={Link} to="/" >
                <Dropdown.Menu>
                    <Dropdown.Item  as={Link} to="users">
                        Colectioncs
                    </Dropdown.Item>
                    <Dropdown.Item  as={Link} to="/users">
                        Collections
                    </Dropdown.Item>
                    <Dropdown.Item to="/upload" exact className="button">
//                        Upload
//                  </Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        </div>
    )
}

export default NavBar;


